// src/components/Hero.js
import React from "react";
import { FaGithub, FaLinkedin } from "react-icons/fa";

const Hero = () => {
  return (
    <section id="about" className="h-[60vh] flex items-center bg-blue-50">
      <div className="max-w-4xl mx-auto px-4 text-center">
        <h1 className="text-3xl md:text-4xl font-bold mb-2">Hi, I'm Pavithra</h1>
        <h2 className="text-lg md:text-xl text-gray-600 mb-4">Full Stack Developer</h2>
        <div className="flex justify-center space-x-6 text-2xl">
          <a href="https://github.com/" target="_blank" rel="noopener noreferrer">
            <FaGithub className="hover:text-blue-500 transition" />
          </a>
          <a href="https://linkedin.com/" target="_blank" rel="noopener noreferrer">
            <FaLinkedin className="hover:text-blue-500 transition" />
          </a>
        </div>
      </div>
    </section>
  );
};

export default Hero;
